script:
  script: |-
    import requests
    import json

    import argparse
    import os
    import time
    from google.oauth2 import service_account

    import googleapiclient.discovery
    from six.moves import input
    import webbrowser
    from oauth2client.client import flow_from_clientsecrets
    from oauth2client.client import OAuth2WebServerFlow
    from oauth2client.client import AccessTokenCredentials
    # data = {}
    # data['type'] = "service_account"
    # data['project_id'] = demisto.params()['project_id']
    # data['private_key_id'] = demisto.params()['private_key_id']
    # data['private_key'] = demisto.params()['private_key']
    # data['client_email'] = demisto.params()['client_email']
    # data['client_id'] = demisto.params()['client_id']
    # data['auth_uri'] = "https://accounts.google.com/o/oauth2/auth"
    # data['token_uri'] = "https://oauth2.googleapis.com/token"
    # data['auth_provider_x509_cert_url'] = "https://www.googleapis.com/oauth2/v1/certs"
    # data[
    #     'client_x509_cert_url'] = demisto.params()['client_x509_cert_url']
    token = demisto.params()['access_token']


    def get_project(args):
        # credentials = service_account.Credentials.from_service_account_info(data)
        credentials = AccessTokenCredentials(token,'my-user-agent/1.0')
        manager = googleapiclient.discovery.build('cloudresourcemanager', 'v1', credentials=credentials)
        projectId = args.get('projectId')
        operation = manager.projects().get(projectId = projectId).execute()
        response = {}
        response['Id'] = operation['projectId']
        response['Name'] = operation['name']
        response['Labels'] = 'N/A'
        response['Parent'] = operation['parent']
        response['LifecycleState'] = operation['lifecycleState']

        humanread = {}
        humanread['Project Id'] = operation['projectId']
        humanread['Project Name'] = operation['name']
        humanread['Project Creation Time'] = operation['createTime']
        humanread['Project Labels'] = 'N/A'
        humanread['Project Lifecycles State'] = operation['lifecycleState']
        humanread['Project Parent'] = operation['parent']

        md = tableToMarkdown('Get details of a Google Cloud Project', humanread)

        entry = {
            'Type': entryTypes['note'],
            'Contents': response,
            'ContentsFormat': formats['json'],
            'ReadableContentsFormat': formats['markdown'],
            'HumanReadable':md,
            'EntryContext': {
                'Gcp.Project': response
            }
        }
        demisto.results( entry )

    def list_projects(args):
        # credentials = service_account.Credentials.from_service_account_info(data)
        credentials = AccessTokenCredentials(token,'my-user-agent/1.0')
        manager = googleapiclient.discovery.build('cloudresourcemanager', 'v1', credentials=credentials)
        filter = args.get('filter')
        operation = manager.projects().list(filter = filter).execute()
        response = []
        humanread = []
        for project in operation['projects']:
            response.append({
                'Id': project['projectId'],
                'Name' : project['name'],
                'Label': 'N/A' if 'labels' not in project else project['labels'],
                'Parent':project['parent'],
                'Lifecycle' : project['lifecycleState'],
            })
            humanread.append({
                'Project Name' : project['name'],
                'Project ID' : project['projectId'],
                'Project Creation Time':project['createTime'],
                'Project Lifecycle State':project['lifecycleState'],
                'Project Parent':project['parent']
            })
        md = tableToMarkdown('List of all the Google Cloud Projects', humanread)
        entry = {
            'Type': entryTypes['note'],
            'Contents': operation,
            'ContentsFormat': formats['json'],
            'ReadableContentsFormat': formats['markdown'],
            'HumanReadable':md,
            'EntryContext': {
                'Gcp.Project': response
            }
        }
        demisto.results( entry )

    def create_project(args):
        name = args.get('projectName')
        parentType = args.get('parentType')
        parentId = args.get('parentId')
        labels = args.get('lables')
        projectId = args.get('projectId')
        # credentials = service_account.Credentials.from_service_account_info(data)
        credentials = AccessTokenCredentials(token,'my-user-agent/1.0')
        manager = googleapiclient.discovery.build('cloudresourcemanager', 'v1', credentials=credentials)
        # body = {
        #     "name":name,
        #     "parent":{
        #         'type':parentType,
        #         'id':parentId
        #     },
        #     "labels":labels,
        #     'projectId':projectId
        # }

        body = {
          "labels": {},
          "parent": {
            "id": parentId,
            "type": parentType
          },
          "name": name,
          "projectId": projectId
        }
        operation = manager.projects().create(body=body).execute()

        humanread = {
            'Server assignned name':operation['name'],
            # 'Done': operation['done'],
            # 'Error message':operation['error']
        }
        md = tableToMarkdown('Create a new Google Cloud Project', humanread)

        entry = {
            'Type': entryTypes['note'],
            'Contents': response,
            'ContentsFormat': formats['json'],
            'ReadableContentsFormat': formats['markdown'],
            'HumanReadable':md
        }
        demisto.results( entry )

    def delete_project(args):
        # credentials = service_account.Credentials.from_service_account_info(data)
        credentials = AccessTokenCredentials(token,'my-user-agent/1.0')
        manager = googleapiclient.discovery.build('cloudresourcemanager', 'v1', credentials=credentials)
        projectId = args.get('projectId')
        operation = manager.projects().delete(projectId=projectId).execute()
        response = {}
        response['Id'] = projectId
        humanread = {}
        humanread['Project ID'] = projectId
        md = tableToMarkdown('delete project', humanread)
        entry = {
            'Type': entryTypes['note'],
            'Contents': response,
            'ContentsFormat': formats['json'],
            'ReadableContentsFormat': formats['markdown'],
            'HumanReadable':md,
            'EntryContext': {
                'Gcp.Project': response
            }
        }
        demisto.results( entry )

    def update_project(args):
        # credentials = service_account.Credentials.from_service_account_info(data)
        credentials = AccessTokenCredentials(token,'my-user-agent/1.0')
        manager = googleapiclient.discovery.build('cloudresourcemanager', 'v1', credentials=credentials)
        projectId = args.get('projectId')
        name = args.get('projectName')
        parentType = args.get('parentType')
        parentId = args.get('parentId')
        body = {
            "parent": {
                "id": parentId,
                "type": parentType
            },
            "labels": {},
            "name": name
        }
        operation = manager.projects().update(projectId=projectId, body = body).execute()
        response = {}
        response['Id'] = operation['projectId']
        response['Name'] = operation['name']
        response['Labels'] = 'N/A' if 'labels' not in operation else operation['labels']
        response['Parent'] = operation['parent']
        response['LifecycleState'] = operation['lifecycleState']
        humanread = {}
        humanread['Project Id'] = operation['projectId']
        humanread['Project Name'] = operation['name']
        humanread['Project Creation Time'] = operation['createTime']
        humanread['Project Labels'] = 'N/A' if 'labels' not in operation else operation['labels'],
        humanread['Project Lifecycle State'] = operation['lifecycleState']
        humanread['Project Parent'] = operation['parent']

        md = tableToMarkdown('Updated Google Cloud Project', humanread)
        entry = {
            'Type': entryTypes['note'],
            'Contents': response,
            'ContentsFormat': formats['json'],
            'ReadableContentsFormat': formats['markdown'],
            'HumanReadable':md,
            'EntryContext': {
                'Gcp.Project': response
            }
        }
        demisto.results( entry )

    def get_organization(args):
        # credentials = service_account.Credentials.from_service_account_info(data)
        credentials = AccessTokenCredentials(token,'my-user-agent/1.0')
        manager = googleapiclient.discovery.build('cloudresourcemanager', 'v1', credentials=credentials)
        name = args.get('organizationId')
        operation = manager.organizations().get(name = name).execute()
        response = {}
        response['Name'] = operation['name']
        humanread = {}
        humanread['Organization Name'] = operation['name']
        humanread['Organization Owner'] = operation['owner']
        humanread['Organization Creation Time'] = operation['creationTime']
        humanread['Organization Lifecycle State'] = operation['lifecycleState']

        md = tableToMarkdown('Get details of a Google Cloud Organization', humanread)
        entry = {
            'Type': entryTypes['note'],
            'Contents': response,
            'ContentsFormat': formats['json'],
            'ReadableContentsFormat': formats['markdown'],
            'HumanReadable':md,
            'EntryContext': {
                'Gcp.Org': response
            }
        }
        demisto.results( entry )

    def search_organization(args):
        # credentials = service_account.Credentials.from_service_account_info(data)
        credentials = AccessTokenCredentials(token,'my-user-agent/1.0')
        manager = googleapiclient.discovery.build('cloudresourcemanager', 'v1', credentials=credentials)
        search_filter = args.get("filter")
        body = {
            "filter":search_filter
        }
        operation = manager.organizations().search(body = body).execute()
        response = []
        humanread = []
        for organization in operation['organizations']:
            response.append({
                'Name': organization['name'],
                'DisplayName' : organization['displayName'],
                'Owner' : organization['owner'],
                'CreationTime': organization['creationTime'],
                'LifecycleState' : organization['lifecycleState']
            })
            humanread.append({
                'Organization Name':organization['name'],
                'Organization Display Name': organization['displayName'],
                'Organization Owner':organization['owner'],
                'Organization Creation Time':organization['creationTime'],
                'Organization Lifecycle State':organization['lifecycleState']
            })

        md = tableToMarkdown('Search for a Google Cloud Organization', humanread)
        entry = {
            'Type': entryTypes['note'],
            'Contents': response,
            'ContentsFormat': formats['json'],
            'ReadableContentsFormat': formats['markdown'],
            'HumanReadable':md,
            'EntryContext': {
                'Gcp.Org': response
            }
        }
        demisto.results( entry )


    # The command demisto.command() holds the command sent from the user.
    if demisto.command() == 'test-module':
        # This is the call made when pressing the integration test button.
        # credentials = service_account.Credentials.from_service_account_info(data)
        credentials = AccessTokenCredentials(token,'my-user-agent/1.0')
        manager = googleapiclient.discovery.build('cloudresourcemanager', 'v1', credentials=credentials);
        demisto.results('ok')
        sys.exit(0)
    if demisto.command() == 'fetch-incidents':
        # You can store the last run time...
        demisto.setLastRun({'time': 'now'})
        # And retrieve it for use later:
        lastRun = demisto.getLastRun()
        # lastRun is a dictionary, with value "now" for key "time".
        # JSON of the incident type created by this integration
        demisto.incidents([{"Name":"Incident #1"},{"Name":"Incident #2"}])
        sys.exit(0)
    if demisto.command() == "gresource-get-project":
        get_project(demisto.args())

    if demisto.command() == "gresource-list-project":
        list_projects(demisto.args())

    if demisto.command() == "gresource-create-project":
        create_project(demisto.args())

    if demisto.command() == "gresource-delete-project":
        delete_project(demisto.args())

    if demisto.command() == "gresource-update-project":
        update_project(demisto.args())

    if demisto.command() == "gresource-get-organization":
        get_organization(demisto.args())

    if demisto.command() == "gresource-search-organization":
        search_organization(demisto.args())
  type: python
  commands:
  - name: gresource-get-project
    arguments:
    - name: projectId
      required: true
      description: The Project ID  (for example, my-project-123)
    outputs:
    - contextPath: Gcp.Project.Id
      description: The unique, user-assigned ID of the Project
      type: string
    - contextPath: Gcp.Project.Name
      description: The user-assigned display name of the Project
      type: string
    - contextPath: Gcp.Project.Labels
      description: The labels associated with this Project
    - contextPath: Gcp.Project.Parent
      description: An optional reference to a parent Resource
    - contextPath: Gcp.Project.LifecycleState
      description: The Project lifecycle state
    description: Retrieves the Project identified by the specified projectId. The
      caller must have read permissions for this Project
  - name: gresource-list-project
    arguments:
    - name: filter
      description: 'An expression for filtering the results of the request. Filter
        rules are case insensitive. The fields eligible for filtering are: - name
        - id - labels.key where key is the name of a label'
    outputs:
    - contextPath: Gcp.Project.Id
      description: The unique, user-assigned ID of the Project
    - contextPath: Gcp.Project.Name
      description: The user-assigned display name of the Project
    - contextPath: Gcp.Project.Label
      description: The labels associated with this Project
    - contextPath: Gcp.Project.Parent
      description: An optional reference to a parent Resource
    - contextPath: Gcp.Project.Lifecycle
      description: The Project lifecycle state
    description: Lists Projects that are visible to the user and satisfy the specified
      filter. This method returns Projects in an unspecified orde
  - name: gresource-create-project
    arguments:
    - name: projectName
      required: true
      description: The user-assigned display name of the Project. For example, My
        Project
    - name: lables
      description: 'The labels associated with this Project. For example, "environment"
        : "dev"'
    - name: projectId
      description: The unique, user-assigned ID of the Project. For example, tokyo-rain-123
    - name: parentType
      required: true
      auto: PREDEFINED
      predefined:
      - organization
      - folder
      description: Required field representing the resource type this id is for.
    - name: parentId
      required: true
      description: Required field for the type-specific id. This should correspond
        to the id used in the type-specific API's
    description: 'Create a project resource '
  - name: gresource-delete-project
    arguments:
    - name: projectId
      required: true
      description: The Project ID (for example, foo-bar-123)
    outputs:
    - contextPath: Gcp.Project.Id
      description: The Project ID (for example, foo-bar-123)
      type: string
    description: Marks the Project identified by the specified projectId (for example,
      my-project-123) for deletion
  - name: gresource-update-project
    arguments:
    - name: projectId
      required: true
      description: The project ID (for example, my-project-123)
    - name: projectName
      description: The user-assigned display name of the Project. For example, My
        Project
    - name: parentType
      required: true
      description: 'Required field representing the resource type this id is for.
        At present, the valid types are: "organization" and "folder"'
    - name: parentId
      required: true
      description: Required field for the type-specific id. This should correspond
        to the id used in the type-specific API's.
    outputs:
    - contextPath: Gcp.Project.Id
      description: 'The unique, user-assigned ID of the Project. '
    - contextPath: Gcp.Project.Name
      description: 'The user-assigned display name of the Project. '
    - contextPath: Gcp.Project.Labels
      description: 'The labels associated with this Project. '
    - contextPath: Gcp.Project.LifecycleState
      description: Project lifecycle states.
    - contextPath: Gcp.Project.Parent
      description: An optional reference to a parent Resource.
    description: Updates the attributes of the Project identified by the specified
      projectId (for example, my-project-123)
  - name: gresource-get-organization
    arguments:
    - name: organizationId
      required: true
      auto: PREDEFINED
      predefined:
      - organizations/
      description: The resource name of the Organization to fetch, e.g. "organizations/1234".
        Add organization id after 'organizations/'
    outputs:
    - contextPath: Gcp.Org.Name
      description: The resource name of the Organization to fetch, e.g. "organizations/1234"
    description: Fetches an Organization resource identified by the specified resource
      name
  - name: gresource-search-organization
    arguments:
    - name: filter
      description: 'An optional query string used to filter the Organizations to return
        in the response. Filter rules are case-insensitive. Organizations may be filtered
        by owner.directoryCustomerId (For eg. owner.directorycustomerid:123456789)
        or by domain (for eg. domain:google.com), where the domain is a G Suite domain. '
    outputs:
    - contextPath: Gcp.Org.Name
      description: The resource name of the Organization to fetch, e.g. "organizations/1234"
      type: string
    - contextPath: Gcp.Org.DisplayName
      description: 'A human-readable string that refers to the Organization in the
        GCP Console UI. '
      type: string
    - contextPath: Gcp.Org.Owner
      description: The owner of this Organization
    - contextPath: Gcp.Org.CreationTime
      description: Timestamp when the Organization was created.
      type: string
    - contextPath: Gcp.Org.LifecycleState
      description: The organization's current lifecycle state. Assigned by the server.
    description: Searches Organization resources that are visible to the user and
      satisfy the specified filter.
  dockerimage: fuxuyu/demisto-gcp:4
  runonce: false
